import React, { Component } from "react";
import Header from "../home/header/Header";
import Portfolio from "../home/portfolio/Portfolio";
import "./Home.css";

class Home extends Component {
  state = {};

  componentDidMount() {
    this.getSlides();
  }

  render() {
    return (
      <div className="home">
        <Header />
        <Portfolio />
      </div>
    );
  }
}

export default Home;
